lastEditDate.onChange:
var applications = $getGrid('applications')
var recordsToUpdate = []

for (let appRow of applications) {
    var {
        rowKey,
        company,
        companyLastEditDate,
    } = appRow

    if (!company) continue
    if (!company.includes(rowData.rowKey)) continue

    if (!companyLastEditDate) {
        recordsToUpdate.push(rowKey)

        continue
    }

    // if ((Date.now() - companyLastEditDate) < 7.884e+9) continue

    recordsToUpdate.push(rowKey)
}

for (let appRowKey of recordsToUpdate) {
    $setDataGridVal(
        'applications',
        `${appRowKey}.companyLastEditDate`,
        rowData.lastEditDate
    )
}
